import axios from "axios";

export const login=(data)=>{
    return axios.post("http://localhost:8080/login",data ,{headers:{
        'Access-Control-Allow-Origin': '*',
        'Access-Control-Allow-Headers': '*',
        'Access-Control-Allow-Credentials': true,
    }});
}
